import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/home" element={<h1>Home</h1>} />
        <Route path="/register" element={<h1>About</h1>} />
      </Routes>
    </Router>
  );
}

export default App;
